new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="美国医师协会",Remark="",Operator="",Country=129,Introduction=@"美国医师协会 American College of Physicians 成立于1915年，是美国最大的医学专业协会。它的宗旨是通过在医师中间培养高超的行业水平和职业的医学道德来促进国民的健康水平。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="美国神经放射学会",Remark="",Operator="",Country=129,Introduction=@"美国神经放射学会（American Society of Neuroradiology）1962年4月19日在纽约成立。现有神经放射学领域的内科医生专家3000名。神经放射学是通过X射线、计算机体层摄影（CT）、磁共振成像（MRI）以及血管照相术对中枢神经系统、大脑、头部和颈部疾病诊断的附属临床学科，在医院临床、学术/教育机构和私人开业上都被充分地使用。美国神经放射学会在每年的四、五月召开年会，分别对普通神经影像、介入神经影像、头颈部影像、小儿神经影像和脊柱影像学等亚专业进行专题讨论。其《美国神经放射学杂志》被Index Medicus, Index Neuroradiologicum和Current Contents国际著名工具书和数据库收录、索引。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="美国植物学会",Remark="",Operator="",Country=129,Introduction=@"美国植物学会是一个非赢利性组织，创建于1906年。其宗旨是推动在植物形态、功能、多样性、繁殖、进化、利用以及植物与环境交互影响等方面的基础性研究。为实现这一目标，该学会持续提供关于植物学的正式与非正式教育，鼓励植物学基础性研究，提供有关植物学、生态学方面的专业技能、发展方向以及就业指导信息，利用出版、会议等形式，促进学科领域内部及学科之间的学术交流。BSA涉及到植物学的所有研究领域，包括植物发育学、生理学、繁殖生物学、植物进化理论、藻类学、遗传学、真菌学、生态学、分子生物学、古植物学等。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="北京雅昌艺术图书有限公司",Remark="",Operator="",Country=242,Introduction=@"雅昌创建于1993年，拥有北京、深圳、上海三大运营基地，杭州、广州两大艺术服务中心，以及广西、香港两个办事处。产品和服务遍及全球几十个国家和地区。
二十年来，雅昌将“通过‘为人民艺术服务’实现‘艺术为人民服务’”确定为企业宗旨，将成为卓越的艺术服务机构作为企业愿景，始终以“让艺术走进每个人的生活”为使命，致力于成为中国新经济文化产业的开拓者，不断追求先进的科学技术、创新的经营管理模式，为中国及世界文化艺术界提供综合服务，为广大消费者提供文化艺术产品。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="American Journal of Tropical Medicine and Hygiene",Remark="",Operator="",Country=129,Introduction=@"《AMERICAN JOURNAL OF TROPICAL MEDICINE AND HYGIENE》是1952年American Society of Tropical Medicine and Hygiene出版的期刊，刊期为Monthly，刊载方向为医学-公共卫生、环境卫生与职业卫生"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="科学出版社",Remark="",Operator="",Country=242,Introduction=@"中国科技出版传媒股份有限公司（科学出版社）由中国科学院编译局与30年代创建的有较大影响的龙门联合书局于1954年8月合并成立。1993年8月恢复使用“龙门书局”副牌。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="National Academies Press",Remark="",Operator="",Country=242,Introduction=@"美国国家科学院下属的学术出版机构，主要出版美国国家科学院、国家工程院，医学研究所和国家研究委员会的报告。从1994年就开始提供免费的在线内容，所有的PDF版图书对发展中国家都是免费的，65%的内容对所有国家用户免费。

美国国家学术出版社(National Academies Press，简称NAP)，社负责美国国家科学院(National Academy of Sciences)、美国国家工程学院(National Academy of Engineering)、美国国家医学院(The Institute of Medicine)和美国国家研究委员会(National Research Council)相关研究成果的出版，其目标是在维持收支平衡的同时尽可能广泛地传播这些研究机构。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="IOS Press",Remark="Impacting the world of science",Operator="",Country=242,Introduction=@"IOS Press是一家独立的国际STM出版社，于1987年在阿姆斯特丹成立。我们的指导原则之一是拥抱精益组织提供的好处。我们的目标是保持简单，但我们努力达到最高的专业标准。我们的业务实践是直接，透明和合乎道德的。

我们敬业和经验丰富的员工是我们最大的资产。在阿姆斯特丹的核心员工的指导下，我们管理着一个由编辑，作家，图书馆员，代表，代理商，图书进口商，内容托管人和排字工人组成的全球网络，这些人都为我们的业务做出了积极的贡献。我们重视并维持与我们所有联系人的长期关系。

我们更喜欢非正式性，并且在日常业务中保持开放和灵活。我们精简的组织结构使我们能够最大程度地减少官僚主义，并能在非常个人的层面上进行快速有效的沟通。我们希望使与IOS Press的合作愉快而有意义。

IOS Press是任何出版项目的可靠合作伙伴。我们致力于提高质量并应对不断增加的最后期限带来的挑战。由于STM出版行业日新月异，我们将大量资源投入到新技术的开发和创新中。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="中国科学院上海有机化学研究所",Remark="Shanghai Institute of Organic Chemistry, Chinese Academy of Sciences",Operator="",Country=242,Introduction=@"中国科学院上海有机化学研究所（英文：Shanghai institute of Organic Chemistry,Chinese Academy of Sciences），简称上海有机所，是一个集基础研究、应用研究和高技术创新研究为一体的综合性化学研究所。有机所创建于1950年6月，是中国科学院首批成立的15个研究所之一，前身是建立于1928年7月的前中央研究院化学研究所。1998年上海有机所首批进入中国科学院知识创新工程。
上海有机所以多学科交叉为特色，以有机化学基础研究和应用基础研究为主导，围绕人口与健康、资源与环境、新材料三大领域，重点突出健康和生命、环境和生态系统、资源利用与开发、新材料、能源开发应用和国家安全等领域中相关的基本有机化学课题等六大研究方向。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="Genetics Society of America",Remark="",Operator="",Country=242,Introduction=@"美国遗传学学会（Genetics Society of America，GSA）出版的Genetics《遗传学》1916年创刊，全年12期，刊载遗传进化、突变、细胞遗传、分子遗传和人口遗传等方面的研究论文。在131种领域核心刊物内排名第32位，2006年影响因子：4.232。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="Radiological Society of North America",Remark="",Operator="",Country=242,Introduction=@"北美放射学会Radiological Society of North America（RSNA）成立于1915年，是一个既有超过40，000名医疗专家的学会，其中包括放射学家、辐射癌症医师、医疗物理学家和科学家，都是放射医学科学和技术方面的领导者。北美放射学会每年组织世界最大的放射学年会。出版两本重要的评论学报。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="Project HOPE—Health Opportunity for People Everywhere",Remark="",Operator="",Country=242,Introduction=@"世界健康基金会（简称世健会，Project HOPE—Health Opportunity for People Everywhere）1958年创建于美国，总部设在弗吉尼亚州， 是一个国际知名的非赢利的健康教育组织。其宗旨是帮助人们长期有效地自助，拯救人类生命，减轻病人痛苦，帮助社区改进健康护理。自从1958年以来，世界健康基金会的教育者们已经培训了世界各地1300万卫生专业人员。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="北京晨星创投科技有限公司",Remark="",Operator="",Country=242,Introduction=@"创课之星《全球大学生创新创业与就业升学视频资源平台》由北京晨星创投科技有限公司研发制作，为大学生创新就业创业、英语四六级考试、考研、教师资格证考试等提供资料。

