new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="GeoScienceWorld",Remark="",Operator="",Country=242,Introduction=@"GeoScienceWorld（GSW）出版27种地球科学领域相关的期刊文献，包括专题论文、地图和资料集等。主题涵盖：石油地质、地质学、地震学、地球科学的环境工程、地质的探测与采矿、地质化学、古生物学、地球物理学、孢粉学、地下水文学等，被多家国际著名检索工具书和数据库收录、索引。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="多科学出版有限公司",Remark="",Operator="",Country=129,Introduction=@"多科学出版有限公司 Multi-science 成立于 1961年，始终着眼于能量，声学，工程学科书籍的出版，并把各国的大学（和相关机构）作为它的核心市场。多科学出版有限公司运作期刊的切入点成功的填补了科学文献领域的空白，响应了科技的发展并促进新学科的产生。公司在期刊领域独树一帜，出版的期刊内容并非与现有期刊雷同。 Multi-science 是社会和学术出版商协会的成员，也是科学技术和医药出版商的国际机构的成员。其旗下期刊被多家国际著名检索工具书和数据库收录、索引，包括： Congressional Information Service、 Cambridge Scientific Abstracts、 Progress in Environmental  Science、 Fuel & Energy Abstracts、 Journal of Energy Literature、 Engineering Index 、 Applied Mechanics Reviews 。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="美国农业生物工程师学会",Remark="American Society of Agricultural and Biological Engineers",Operator="",Country=129,Introduction=@"美国农业生物工程师学会（ ASABE ）成立于 1907年，是一个教育与科研机构，致力于农业、食品与生物系统的工程应用，拥有 100多个国家的 9000多名成员。该学会的专业领域主要包括：生物工程、食品与加工技术、信息与电工技术、动力与机械、土壤与水、结构与环境、人机工程学、安全与健康、新研究领域。出版物涉及农业、食物和生物系统技术，还包括环境与自然资源。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="全国人大常委会办公厅",Remark="",Operator="",Country=242,Introduction=@"全国人民代表大会常务委员会办公厅，是全国人大常委会的综合服务机构。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="深圳职业技术学院",Remark="",Operator="",Country=242,Introduction=@"深圳职业技术学院是广东省主管、深圳市人民政府举办的一所专科层次全日制普通高等学校。学校创建于1993年，原名深圳高等职业技术学院，1997年更名为深圳职业技术学院，2001年学校先后与国内129所高校签订联合培养硕士研究生、博士研究生协议，2003年通过教育部高职高专人才培养工作水平评估，2012年首次开始招收本科生。"},
new DatabaseProvider{ Id=Guid.NewGuid(),CreatedTime=DateTime.Now,ProviderName="美国生态学会",Remark="",Operator="",Country=129,Introduction=@"美国生态学会（ Ecological Society of America ，简称 ESA）成立于 1915年，是大学、政府机构和非政府机构的联合体。利用生态学家之间的交流来发展生态科学，提高对生态科学重要性的认识，增加供生态科学研究用的信息资源，促使决策者在制订环境政策时更多地依靠生态科学。该联合体成员都是从事相关研究、教育和实际工作，为环境问题的研究提供了广泛的知识，其中包括生态技术、自然资源管理、生态恢复、臭氧和全球气候变化、生态系统管理、物种灭绝和生物多样性的丧失、栖息地的变化和破坏等多方面。"},
